import Vue from 'vue';
import App from './App.vue';
import router from './router';
import store from './store'; // Import the store

Vue.config.productionTip = false;

new Vue({
  router,
  store, // Use the store
  render: h => h(App),
  created() {
    this.$store.dispatch('checkAuthentication'); // Ensure authentication state is checked on load
  }
}).$mount('#app');
